@implementation AssetKeysetRegistry

+ (NSArray<NSData *> *) mangledKeysetsWithCStrings:(const char **) cstrs count:(NSUInteger) count
{
    NSMutableArray<NSData *> *result = [NSMutableArray array];
    for ( int i = 0; i < count; i++) {
        NSData *key = [NSData dataWithBytesNoCopy:(void *)cstrs[i]
                                           length:strlen(cstrs[i])
                                     freeWhenDone:NO];
        [result addObject:key];
    }
    return [[result copy] autorelease];
}

+ (NSArray<NSData *> *) keysetFor:(NSString *) provider
{
    NSArray<NSData *> *result = nil;
    
    if ( [provider isEqualToString:@"nex.bep"] ) {
        size_t count = sizeof(_mangledKeysNEX) / sizeof(char *);
        result = [self mangledKeysetsWithCStrings:_mangledKeysNEX count:count];
    }
    return result;
}
@end
